import React from "react";
import './App.css';
import NewSelect from './NewSelect';

function App() {
    document.title = "Greensoftweb"

    return (
        <div>
            <header className={'App-header fst-italic fs-1 fw-bold bg-white'}>
                Greensoft
            </header>
            <div>
                <NewSelect/>
            </div>
        </div>
    );
}

export default App;
